import React from 'react';

const NavbarContainer = styled.nav`
    width: 100%;
            padding: 20px 30px;
            box-sizing: border-box;
            position: fixed;
            z-index: 9999;
            background-color: #fff;
            box-shadow: 0.5px 0.5px 5px gray;
`;
const Navbar = () => {
  return (
    <div>Navbar</div>
  );
};

export default Navbar;
